import axios from "axios";
import { Component } from "react";
import './App.css';
import useAlgo from "./useAlgo"



const App = () =>{
    var a = false;
    var b = false;
    var c = false;
    var url = './Food3.json'



    const Voila = () => {
      console.log('yo')
      url = './popularpoll.json'
      a = true;
    }
    const Pop = () => {
      console.log('ho')
      b = true;
    }
    const Fresh = () =>{
      console.log('ho')
      url = './Heuristic.json'
      c = true;
    }


    return (
    <div>
    <button  id='btn1' onClick={Voila}> Random </button>
    <button  id='btn2' onClick={Pop}> Popular </button>
    <button  id='btn3'onClick={Fresh}> Fresh </button>
    {useAlgo(url)}

    </div>
  )};
export default App
